import React from 'react';
import ReactDOM from 'react-dom';
import './CreatorConnect.css';
import { Route, BrowserRouter as Router, Link } from 'react-router-dom';
import {render} from 'react-dom';

import * as serviceWorker from './serviceWorker';
import Home from './home';
import UsersArray from './usersArray';


var homePage;
const routing = (
  <Router>
      <Route path="/home" component={UsersArray}/>
      <Route path="/test" component={Home} />
  </Router>
)
console.log(routing.props.children.props);//toString());
if(routing == "/home")
{
  ReactDOM.render(<Home />, document.getElementById("root"));
  ReactDOM.render(routing, document.getElementById("users"));
}

//ReactDOM.render(routing, document.getElementById('cards'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
